    false,nt"url": null,nt"notes": "This is the fiscal year 2001 annual narrative
    report for Neal Smith National Wildlife Refuge.  The report begins with information
    about monitoring and studies which includes a breeding bird point count, a butterfly
    count, a survey of Henslowu2019s Sparrows, a monitoring project for the Walnut Creek
    Watershed, various vegetative studies, and a survey of bison diets.  Habitat restoration
    and habitat management projects are also covered; activities include planting, harvesting,
    mowing, grazing, haying, pest plant control, and fire management.  Fish and wildlife
    management are discussed next with emphasis on reintroduction of bison and elk to
    the area.  Coordination activities- including interagency, tribal, and private landownership
    coordination- are outlined, as well as resource protection.  Resource protection
    activities include law enforcement and land acquisition.  Information about public
    education and recreation is given including education, school programs, and seminars.
     Finally, refuge planning and administration are discussed.  Lists of refuge personnel
    and volunteer programs are provided.",nt"license_title": "License Not Specified",nt"extras":
